webpackJsonp([82738739147053],{792:function(a,n){a.exports={data:{markdownRemark:{frontmatter:{title:"MALO",type:"lyrics"},html:"<h1>MALO</h1>\n<section>\n<p>Oj, kak mne vozduha malo — <br>\np'ju ja vozduh pialoj,<br>\np'ju i ne mogu napit'sja — <br>\nvozduh ja kljuju pticej.</p>\n<p>Oj, kak zemli‐to mne malo — <br>\nem ja zemlju stakanom,<br>\nem i ne mogu naest'sja — <br>\ns neju ja s#edaju detstvo.</p>\n<p>Oj, kak ognja‐to mne malo — <br>\nl'ju ogon' v sebja alyj,<br>\nl'ju i podlivaju masla<br>\ni poju ognjom astru.</p>\n<p>Oj, kak vody‐to mne malo — <br>\nskol'ko vod utekalo,<br>\nstol'ko byl togda suhoj<br>\npolyhajushhej travoj.</p>\n<p>Mgla za glaza legla,<br>\nnevest' kuda zvala,<br>\nnevestoju zvalas',<br>\nlajala i vilas'.</p>\n<p>Ja za glazami svil<br>\niz vetok i svetil<br>\ngnjozda, i v nih ptency<br>\nvoskom kljuvov zhgut vency.</p>\n</section>"},site:{siteMetadata:{languages:{defaultLangKey:"en",langs:["en","ru"]}}}},pathContext:{slug:"/en/lyrics/malo/"}}}});
